import Vue from 'vue';
import Router from 'vue-router';
import Index from './views/Index';
import Detail from './views/Detail';
import NotFound from './components/NotFound';
Vue.use(Router);
export default new Router({
  routes: [{
    path: "/",
    component: Index
  }, {
    path: "/index",
    component: Index
  }, {
    path: "/detail",
    component: Detail
  }, {
    path: "/*",
    component: NotFound
  }]
});
